script: |
  super -f text -I q5550.spq | sort > q5550.out

inputs:
  - name: q5550.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + col1 * tab2.col1 NOT BETWEEN col2 * col2 + - col0 AND + col2;
  - name: tab2

outputs:
  - name: q5550.out
    data: |
      7	31	27
      78	59	26
      79	17	38
